import React, { useEffect } from 'react';
import ISidebar from '../../interfaces/ISidebar';

interface Props {
  sidebar: ISidebar;
}

const Sidebar = ({ sidebar: { title, logoPath, links } }: Props) => {
  const linkCol: Array<object> = [];

  useEffect(() => {
    for (let i: number = 0; i < links.length; i++) {
      linkCol.push(
        <>
          {
            links.slice(i, i + 1).map(
              (l) => {
                return (
                  <div>
                    {l.title}
                  </div>
                )
              }
            )
          }
        </>
      )
    }
  })

  return (
    <>
      <div>
        <img className="" src={logoPath} alt="logo" />
        {title}

      </div>
    </>
  )
}

export default Sidebar;
